INSERT INTO `app_settings` (`info_text`) VALUES
('<p>Book Cities is a iOS smartphone app that helps you discover and search new bookstores. It shows you the nearest stores wherever you go (Near Me). The app contains opening hours, addresses, contact and store-descriptions. Filter functions allow you to select bookstores by categories. You can mark your favorite bookstores and make your own list (My List). Spread the word: Share stores and your lists with friends or on social media.<br />Bookstores may be dying, but before they are completely extinct, let&rsquo;s visit them as often as possible!</p>\r\n<p>Visite the website to submit your shop: <a href=\"http://bookcities.org/\" target=\"_blank\">www.bookcities.org<br /></a><a href=\"mailto:contact@bookcities.org\">contact@bookcities.org</a></p>\r\n<p>Many thanks go to Christoph Schifferli, Gloria Wismer from Edition Patrick Frey, Lukas Haller from jrp Ringier, Johannes Breyer, J&eacute;r&ocirc;me Collomb for their support and help.</p>\r\n<p>&copy; 2017, <a href=\"http://annahaas.ch/\">Anna Haas</a>&nbsp;</p>');
